		this.lName = lName;
		this.imgurl = imgurl;
		this.street = street;
		this.city = city;
		this.state = state;
		this.zip = zip;
		this.age = age;
		this.height = height;
		this.weight = weight;
		this.hcolor = hcolor;
		this.ecolor = ecolor;
		this.feature = feature;
		this.special = special;
		this.action = action;
		this.report = report;
